import React from "react";
import TuitItem from "./tuits-item";
import { useSelector } from "react-redux";

const TuitsList_a7 = () => {
    const tuitsArray = useSelector(       // retrieve state from the store
        (state) => state.tuits
    )

    return (

        <ul className="list-group">
            {
                tuitsArray.map(tuits =>
                    <TuitItem
                        key={tuits._id}
                        tuits={tuits}
                    />
                )
            }
        </ul>
    );
};

export default TuitsList_a7;
